import axios from "axios";
import swal from "sweetalert";
import * as Yup from "yup";

// ==============  üìçinitialValues register ===================
export const initialValues = {
  phone: "",
  password: "",
  confirmPassword: "",
};



//===============  üìçvalidationSchema register ===============
export const onSubmit = () => {
  axios.post("http://ecomadminapi.azhadev.ir/api/auth/register").then((res) => {
    console.log(res);
    if (res.status == 200) {
      swal(res.data.message);
